import React from 'react'
import "./Service.css"
import ServiceElement from './subComponents/ServiceElement';

function Service() {
  return (
    <section className="service" id="Service">
      <div className="container section_wrapper">
        <h1>Service</h1>
        <ServiceElement />
      </div>
    </section>
  );
}

export default Service
